import React from "react";
import "./Nav.css";

function Nav() {
  return (
    <div>
      <nav>
        <div className="nav">
          <ul>
            <li>
                <a href = "" >Teddy Bares</a>
                <a href = "" >Capet</a>
                <a href = "" >Folower Pots</a>
                <a href = "" >Plastics</a>
                <a href = "" >About Us</a>
                <a href = "" >Help </a>
                <a href = "" >Contact Us</a>

            </li>
          </ul>
        </div>
      </nav>
    </div>
  );
}

export default Nav;
